  };

  return (
    <div className="submitted-codes-container">
      <h1 className="submitted-title">Submitted Codes</h1>
      <div className="codes-list">
        {submittedCodes.map((code, index) => (
          <div key={index} className="code-card" onClick={() => handleCodeClick(code)}>
            <p><strong>Title:</strong> {code.title}</p>
            <pre>{code.code}</pre>
          </div>
        ))}
      </div>
      <button className="back-button" onClick={() => navigate('/blog')}>Back to Submit</button>
    </div>
  );
}

export default SubmittedCodesPage;
